import React, {useState} from 'react';
import './App.css';
import {Counter} from "./Counter";
import {MaxMin} from "./Max&&Min";


function App() {

    const [MaxValue, SetMaxValue] = useState(5)
    const [MinValue, SetMinValue] = useState(0)
    const[editMode,SetEditMode]=useState(false)

    const Inc = () => {
        SetMinValue(prevState => prevState + 1)
    }
    const Reset = () => {
        SetMinValue(0)
    }

    const KeyDown =()=> {
SetEditMode(!editMode)
    }

    return (
        <div className="App">

            <Counter inc={Inc} reset={Reset} disable={MaxValue} StartValue={MinValue} editMode={editMode} />
            <MaxMin disable={MaxValue} StartValue={MinValue} keyDown={KeyDown} />

        </div>
    );
}

export default App;
